import React from 'react'
import styles from './ButtonCourseItem.module.scss'

const ButtonCourseItem = (props) => {
  const { type } = props
  const handleClick = () => {

  }
  const buttonTypeCase = () => {
    switch (type) {
      case 'addToCart':
        return <button
          className={styles.button}
          onClick={handleClick}
          type="button"
        >
          Add to cart
        </button>
      case 'buyNow':
        return <button
          className={styles.button}
          onClick={handleClick}
          type="button"
        >
          Buy now
        </button>
      case 'learnNow':
        return <button
          className={styles.button}
          onClick={handleClick}
          type="button"
        >
          Learn now
        </button>
      case 'extend':
        return <button
          className={styles.button}
          onClick={handleClick}
          type="button"
        >
          Extend
        </button>

      default:
        break
    }
  }
  return (
    <div className={styles.container}>
      <button
        className={styles.button}
        onClick={handleClick}
        type="button"
      >
        Add to cart
      </button>
    </div>
  )
}
export default ButtonCourseItem
